DROP TABLE IF EXISTS `property`;

CREATE TABLE `property` (
  `listing_date` varchar(100) DEFAULT NULL,
  `referencenum` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `type` varchar(100) DEFAULT NULL,
  `size` int DEFAULT NULL,
  `bedrooms` varchar(100) DEFAULT NULL,
  `bathrooms` varchar(100) DEFAULT NULL,
  `price` int DEFAULT NULL,
  `agentnumber` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `city` varchar(100) DEFAULT NULL,
  `area` varchar(100) DEFAULT NULL,
  `developmentname` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `developmentlocation` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`referencenum`),
  KEY `agentcontact_idx` (`agentnumber`),
  CONSTRAINT `property_ibfk_1` FOREIGN KEY (`agentnumber`) REFERENCES `agent` (`phonenumber`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `property_ibfk_2` FOREIGN KEY (`agentnumber`) REFERENCES `agent` (`phonenumber`) ON DELETE CASCADE ON UPDATE CASCADE
);

