DROP TABLE IF EXISTS `review`;

CREATE TABLE `review` (
  `agentnum` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `uname` varchar(30) COLLATE utf8mb4_general_ci NOT NULL,
  `review` varchar(100) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `rating` decimal(2,1) DEFAULT NULL,
  PRIMARY KEY (`agentnum`,`uname`),
  KEY `uname` (`uname`),
  CONSTRAINT `review_ibfk_1` FOREIGN KEY (`uname`) REFERENCES `user` (`username`),
  CONSTRAINT `review_ibfk_2` FOREIGN KEY (`agentnum`) REFERENCES `agent` (`phonenumber`)
);


